            this.setState({typeDemarche: "carte"});
        } else if (type == "passeport") {
            this.setState({typeDemarche: "passeport"});

        } else {
            this.setState({typeDemarche: "immatriculation"});
        }
    }



    render() {

        var element = null;


        if (this.state.typeDemarche == "carte") {
            element = <TableContainer component={Paper}>
            <Table className={useStyles().table} aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Dessert (100g serving)</TableCell>
                  <TableCell align="right">Calories</TableCell>
                  <TableCell align="right">Fat&nbsp;(g)</TableCell>
                  <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                  <TableCell align="right">Protein&nbsp;(g)</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row) => (
                  <TableRow key={row.name}>
                    <TableCell component="th" scope="row">
                      {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer> ;

        } else if (this.state.typeDemarche == "passeport") {

        } else {

        }

        return (
            <div>
                <HeaderCitoyen id={this.props.location.state.idCitoyen}/>
                <hr className="overall-separator" />
                <br></br>

                <h2 className="question-title"> Consultation de la démarche  </h2>

                {element};


                <br></br>
                <div className="end">
                    <center>Copyright <span>&#169;</span> 2021 tous les droits résérvés.</center>
                </div>



            </div>
        )
    }

}


export default ConsulterDemarche;
